public String fibonacciSequence(int n) { 
  int[] a = new int[n]; 
  a[0] = 0; 
  a[1] = 1; 

  for (int i = 2; i < n; i++) { 
    a[i] = a[i-1] + a[i-2]; 
  } 
  return Arrays.toString(a); 
}

